import React, { Component, useEffect, useState } from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome , faBaby , faCheckCircle, faFileAlt , faPlusSquare, faUserMd, faCalendar, faCalendarAlt, faAd, faUserCog, faChevronDown, faCaretDown, faUserAlt, faMapMarker, faCog, faSignOutAlt } from '@fortawesome/free-solid-svg-icons';
import Logo from "../logo1.jpg";
import Profile from "./images/profile.png";
import { Link  } from "react-router-dom";
import classnames from "classnames";
import $ from 'jquery';
import '../components/Navbar.css';
import { NavLink } from 'react-router-dom';
import Slider1 from '../images/slider5.jpg';
import Slider2 from '../images/slider6.jpg';
import Slider3 from '../images/slider13.jpg';
import Slider4 from '../images/slider12.jpg';
// import { Navbar } from "react-bootstrap";




function Navbar() {
  return (
    <div>
      <Navbar bg="light" expand="lg">
  <Container fluid>
    <Navbar.Brand href="#">Navbar scroll</Navbar.Brand>
    <Navbar.Toggle aria-controls="navbarScroll" />
    <Navbar.Collapse id="navbarScroll">
      <Nav
        className="me-auto my-2 my-lg-0"
        style={{ maxHeight: '100px' }}
        navbarScroll
      >
        <Nav.Link href="#action1">Home</Nav.Link>
        <Nav.Link href="#action2">Link</Nav.Link>
        <NavDropdown title="Link" id="navbarScrollingDropdown">
          <NavDropdown.Item href="#action3">Action</NavDropdown.Item>
          <NavDropdown.Item href="#action4">Another action</NavDropdown.Item>
          <NavDropdown.Divider />
          <NavDropdown.Item href="#action5">
            Something else here
          </NavDropdown.Item>
        </NavDropdown>
        <Nav.Link href="#" disabled>
          Link
        </Nav.Link>
      </Nav>
      <Form className="d-flex">
        <FormControl
          type="search"
          placeholder="Search"
          className="me-2"
          aria-label="Search"
        />
        <Button variant="outline-success">Search</Button>
      </Form>
    </Navbar.Collapse>
  </Container>
</Navbar>
    </div>
  );
  }
export default Navbar;
